import React from 'react';

console.log('App.tsx loaded!'); // DODAJ TO

function App() {
  console.log('App component rendering!'); // DODAJ TO

  return (
    <div style={{ padding: '20px' }}>
      <h1>Test - aplikacja działa!</h1>
      <p>Jeśli widzisz ten tekst, React działa poprawnie!</p>
      <hr />
      <h2>Sprawdź konsolę przeglądarki</h2>
      <p>Powinieneś zobaczyć następujące komunikaty:</p>
      <ul>
        <li>Index.tsx loaded!</li>
        <li>Root created!</li>
        <li>App.tsx loaded!</li>
        <li>App component rendering!</li>
        <li>App rendered!</li>
      </ul>
    </div>
  );
}

export default App;
